強度・軽量化を考慮した鍛造アルミ製。鍛造製法の採用により、抜群の強度と軽量化を両立することに成功しました。20mm等の肉厚のスペーサーを使用した場合でも、バネ下重量の増加を最小限にとどめます。ホイール装着によって隠れてしまうパーツですが、表面の仕上げにも手抜きはありません。高品質のハイパーブラック塗装によって、錆び・腐食を防ぎます。性能・品質を高めながら、価格は最小限に抑えました。<br><br>厚み：15mm　PCD：5ｘ108/110　ボア径： 65.1パイ　材質：鍛造アルミ　入り数：2枚1セット　　※4ホール車不可<br><br>※装着される車両、ホイールのPCD・ボア径を必ずご確認してからご購入ください。ハブボルトは付属しておりません。厚み分、首下の長いハブボルトを併用してください。※写真はイメージです、実際の商品と異なる場合があります。<br><br>対応車種：アルファロメオ<br><br>車検対応品<br><br>タイヤホイールセット | ホイールスペーサー<tr><td colspan="2">
